import {Box,HStack,Input, Alert} from "@chakra-ui/react";
import React, { useEffect, useState} from "react";
import axios from "axios";
import CadastroPaciente from "./CadastroP/cadasPaciente";
import './CadastroP/cadasPac.css';
import "./App.css"


function App(){

  
  const url = "http://localhost:8003/questions";
  
  const [posts, setPosts] = useState('')

  function getUser() {
    axios.get(url)
      .then((response) => {
        setPosts(response.data);
      })
      .catch((error) => console.log(error));
  }


  useEffect(() => {
    getUser()
  }, []);


  

  return(
    <div className="App" >  
    <div  className="Colum"> 
      <div className="cont">
          <center><h2  >Selecionar Pergunta</h2></center>
            <HStack spacing="8">
              <Box w="100%" ml="5%" mt="5%">
              
                <Input
                  className="wrap-input"
                  id="cpfInput"
                  value={value}
                  onChange={(e) => (e.target.value)}
                />                
                {posts && (
                  <div key={posts._id}>
                
                  </div>
                )} 
              </Box>
            
            </HStack>
      </div><br></br><br></br>
          <div className="perguntas">
            {posts.length === 0 ? (
              <p>Carregando...</p>
            ) : (
              posts.map((post) => (
                <div className="perguntas" key={post._id}>
                <p>{post.infoPaciente}</p>
                <input 
                  type="checkbox"
                  id={post._id} 
                  value={post._id}
                 
                  
                />
              </div>
              ))
            )}
          </div>
          <div className="container-Finalizar-form-btn">
            <button className="Finalizar-form-btn" 
            onClick={sendDataToBackend} >Finalizar</button>
          </div>
          </div>
    </div>
  )
}

export default App
